def print_consecutive_primes(N):
    primes = []
    for num in range(2, N + 1):
        if num < 2:
            continue
        is_prime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            print(num)
            primes.append(num)
    return primes

